import Notes from './Notes'
import NoteLength from './NoteLength'
import { setGlobal, addCallback, useState, useGlobal } from 'reactn'

const MusicMakerSheet = ({ arraysLists, instrumentLists, currentInstrument, noteLength }) => {
  const [notes, setNotes ] = useGlobal("notes")
  return (
    <>

      <div id="noteSection" className="flex flex-col  w-[80rem] h-[14rem] pt-[2rem]">
        <div id ="test" className='flex border-red-500 w-full'>

          {noteLength.map((item, index) => (
            <NoteLength key={index} item={item} column={index} noteLength={noteLength}/>
          ))}
        </div>  
          <Notes notes={notes} arraysLists={arraysLists} instrumentLists={instrumentLists} currentInstrument={currentInstrument}/>
      </div>
    </>
  )
}

export default MusicMakerSheet


